import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import Grid from '@material-ui/core/Grid';
import logo from '../images/logo.png'

import { makeStyles, useTheme } from '@material-ui/core/styles';

import clsx from 'clsx';
import CssBaseline from '@material-ui/core/CssBaseline';
import MenuIcon from '@material-ui/icons/Menu';

const useStyles = makeStyles((theme) => ({
    root: {
      display: 'flex',
    },
    logo: {
      [theme.breakpoints.down('xs')]: {
        width: "60px",
      },
      [theme.breakpoints.up('md')]: {
        width: "80px",
      },
      [theme.breakpoints.up('lg')]: {
        width: "100px",
      },
    },
    appBar: {
      transition: theme.transitions.create(['margin', 'width'], {
        easing: theme.transitions.easing.sharp,
        duration: theme.transitions.duration.leavingScreen,
      }),
    },
    title: {
      flexGrow: 1,
    },
    drawerHeader: {
      display: 'flex',
      alignItems: 'center',
      padding: theme.spacing(0, 1),
      // necessary for content to be below app bar
      ...theme.mixins.toolbar,
      justifyContent: 'flex-start',
    },
    content: {
      flexGrow: 1,
      padding: theme.spacing(3),
      transition: theme.transitions.create('margin', {
        easing: theme.transitions.easing.sharp,
        duration: theme.transitions.duration.leavingScreen,
      }),
    },
    contentShift: {
      transition: theme.transitions.create('margin', {
        easing: theme.transitions.easing.easeOut,
        duration: theme.transitions.duration.enteringScreen,
      }),
      marginRight: 0,
    },
    nested: {
      paddingLeft: theme.spacing(4),
    },
  }));

export default function App () {

    const classes = useStyles();
    const theme = useTheme();

    return (
        // <AppBar color="transparent" positionsticky="true" >
        // <Toolbar>
        //     <IconButton edge="start" color="inherit" aria-label="menu">
        //     </IconButton>

        //     <div align="center">
        //         <img src={logo} alt="Website Logo" width="75%"/>

        //     <Grid container direction="row" justify="space-evenly" alignItems="center">
        //         <Button color="grey" font-size="40px">Projects</Button>
        //         <Button color="inherit" >Experience</Button>
        //         <Button color="inherit" >Education</Button>
        //         <Button color="inherit" >About</Button>
        //         <Button color="inherit" >Contact</Button>
        //     </Grid>
        //     </div>

        // </Toolbar>
        // </AppBar>

        <div className={classes.root}>
        <br/><br/>
        <CssBaseline />
        <AppBar color="default" positionsticky="true" className={clsx(classes.appBar)} >
          <Toolbar>
            <div className={classes.title}>
              <Link to="/" variant="h5" color="inherit" className={classes.logo}>
                <img src={logo} alt="CBA" width="100"/>
              </Link>
            </div>
            <IconButton
              color="inherit"
              aria-label="open drawer"
              edge="end"
            >
              <MenuIcon />
            </IconButton>
          </Toolbar>
        </AppBar>

      </div>
    )
}
